import React from 'react';
import Position from "../components/position";
import "./352style.css";
function Formation352() {

  const players = [
    "player1",
    "player2",
    "player3",
    "player4",
    "player5",
    "player6",
    "player7",
    "player8",
    "player9",
    "player10",
    "player11"
  ];


  const handleRoleChange = (role) => {
    // Do something with the selected role
    console.log("Selected role:", role);
  };

  return (
    <div className="formation352">
      <div className="attackLane352">
        <Position playerName={players[0]} positionName="ATTACK"
          onRoleChange={handleRoleChange}  />
        <Position playerName={players[1]} positionName="ATTACK" 
          onRoleChange={handleRoleChange}  />
      </div>
      <div className="midLane352">
        <Position playerName={players[2]} positionName="LAT" onRoleChange={handleRoleChange}  />

        <Position playerName={players[3]} positionName="MID" onRoleChange={handleRoleChange}  />
        <Position playerName={players[4]} positionName="MID" onRoleChange={handleRoleChange}  />
        <Position playerName={players[5]} positionName="MID" onRoleChange={handleRoleChange}  />
        <Position playerName={players[6]} positionName="LAT" onRoleChange={handleRoleChange}  />
      </div>
      <div className="backLane352">
        <Position playerName={players[7]} positionName="DEF" onRoleChange={handleRoleChange}  />
        <Position playerName={players[8]} positionName="DEF" onRoleChange={handleRoleChange}  />
        <Position playerName={players[9]} positionName="DEF" onRoleChange={handleRoleChange}  />
      </div>
      <div className="gkLane352">
        <Position playerName={players[10]} positionName="GK" onRoleChange={handleRoleChange}  />
      </div>
    </div>

  );
}

export default Formation352;
